import React from "react";

export default class BarsAnimation extends React.Component{
    instatiate(){
        return <div>
            <p>A</p>
            <p>B</p>
            <p>C</p>
            <p>D</p>
            <p>E</p>
        </div>;
    }
    render(){
        return <div className="containerBars">
            {() => this.instatiate()}
        </div>
    };
}
